import React from 'react';

const commentList = ({comments}) => (
    <React.Fragment>
        <h3>Comments:</h3>
        {comments.map((comment,key) => (
            <div>
                <h5>{comment.username}</h5>
                <p>{comment.text}</p>
            </div>
        ))}


    </React.Fragment>
)

export default commentList;
